import React from "react";
import Card from "./App";
import Array from "./Array";
const favs = "netflix";
function fav() {
  if (favs === "netflix") {
    return (
      <Card
        key={Array[0].id}
        img={Array[0].img}
        title={Array[0].title}
        span={Array[0].span}
        ankar={Array[0].ankar}
      />
    );
  } else {
    return (
      <Card
        key={Array[1].id}
        img={Array[1].img}
        title={Array[1].title}
        span={Array[1].span}
        ankar={Array[1].ankar}
      />
    );
  }
}
const ncard = (val) => {
  return fav();
};

function Return() {
  return Array.map(ncard);
}

export default Return;
